ntF5PDc.mainMacro:
await WaitForLoading();
for (var j=1; j<10; j++) {


    do { //scroll

        scrl = Random(3,9);
        for (var i = 1; i < scrl; i++) {
            await EvaluateScript("var ddE = document.documentElement; ddE.scrollTo(0, ddE.clientHeight/(Math.floor(Math.random()*3)+9) + ddE.scrollTop);");
            await Delay(Random(40,50));
        }
        await Delay (Random(70,80));
    } while (await EvaluateScript("var ddE = document.documentElement; ddE.clientHeight+ddE.scrollTop < ddE.scrollHeight"))
    await ClickRandomInternalLink(true);

       await WaitForLoading();

    tabs = await TabCount();
    var ctabs = 1;
    while (ctabs < tabs) {
        await TabFocus(ctabs++);
        await Delay(10000);
        if ( await EvaluateScript("! window.location.href.includes('time4sounds.tk')") ) {
            await EvaluateScript("setTimeout(function(){var ww = window.open('about:blank', '_self'); ww.close();}, 500);");

        }
    }
    await TabFocus(ctabs);

}

